import React, {useState, useEffect} from "react";
import Axios from "axios";
import LookupResult from "./LookupResult";
import Footer from "./Footer";
import { Link, Switch, Route, useHistory, useLocation } from 'react-router-dom';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

function Profile(props) {
    const history = useHistory();
    const location = useLocation()
    const [isMouseOver, setMouseOver] = useState(false);

    function handleMouseOver() {
        setMouseOver(true);
    }

    function handleMouseOut() {
        setMouseOver(false);
    }

    return (
    <div className="page-container">
        <h1 className="page-header">Customer Profile</h1>
        <div className="result-box">
            <div className="result-labels">
                <p>Full Name:</p>
                <p>License Plate:</p>
                <p>Vehicle Info:</p>
                <p>Plan Type:</p>
                <p>Email Address:</p>
            </div>
            <div className="result-data">
                <p className="result-text">{location.state.nameResult}</p>
                <p className="result-text">{location.state.licenseResult}</p>
                <p className="result-text">{location.state.vehicleResult}</p>
                <p className="result-text">{location.state.planResult}</p>
                <p className="result-text">{location.state.emailResult}</p>
            </div>
        </div>
            <button
                className="lookup-input search"
                style={{backgroundColor: isMouseOver ? "black" : "#E75A25"}}
                onMouseOver={handleMouseOver}
                onMouseOut={handleMouseOut}
                onClick={console.log(props.location.state)}
            >Service Repair
            </button>
        <div className="lookup-footer">
            <button
                className="back-button"
                onClick={() => history.push("/lookup")}>
                <ArrowBackIcon></ArrowBackIcon>
            </button>
            <Footer />
        </div>
    </div>
    )
}

export default Profile;
